var UIConfirmations = function() {
    var n = function() {
        $(".delete_prod_link").on("confirmed.bs.confirmation", function() {
            window.location.href = '?page=prodotti-lista&delete=' + $(this).data('id');
        })
    };
    return {
        init: function() {
            n()
        }
    }
}();
jQuery(document).ready(function() {
    UIConfirmations.init();
    
});